import React from 'react'

const DelBook = () =>{
    return(
        <div id="modal3" className="modal" style={{
          borderRadius:'10px'
        }} >

        <div className="row" style={{
          marginTop:'1rem',
          marginBottom: '-4rem'
        }} >
          <div className="col s6">
          <h4><span style={{
            fontWeight:'bold',
            marginLeft:'40px'
          }} >Add Data</span></h4>
          </div>
          <div className="col s6 right-align">
         <a href="#!"><i className="modal-close material-icons prefix red-text">close</i></a>
          </div>
        </div>
        <div className="row">
            <div className="col s12">
                <p>Data tersebut telah berhasil dihapus</p>
            </div>
      </div>
      </div>
    );
}
export default DelBook;
